import { CardContent, Grid, Typography, Box } from "@material-ui/core"
import CountUp from 'react-countup';




const Card = ({cardTitle, value, desc, lastUpdate}) => {

    return (
        <Grid component={Card}>
            <Box>
                <Typography variant="h5" color="textSecondary">{cardTitle}</Typography>
            </Box>
            <CardContent>
                <Typography variant="h5">
                <CountUp start={0} end={value} duration={3} seperator=","/>
                </Typography>
                <Typography>{desc}</Typography>
                <Typography>{new Date(lastUpdate).toDateString()}</Typography>
            </CardContent>
        </Grid>
    );

}


export default Card;
